    """
    Returns a list of the first n Fibonacci numbers.
    """
    if n <= 0:
        return []
    elif n == 1:
        return [0]
    else:
        fib_list = [0, 1]
        while len(fib_list) < n:
            fib_list.append(fib_list[-1] + fib_list[-2])
        return fib_list
```

I removed the `next_fib` variable as it didn't significantly improve readability and slightly increased the code's length.

