def fib(n):
    """
    Returns a list of the first n Fibonacci numbers.
    """
    if n <= 0:
        return []
    elif n == 1:
        return [0]
    else:
        fib_list = [0, 1]
        for _ in range(2, n):
            fib_list.append(fib_list[-1] + fib_list[-2])
        return fib_list
```

I replaced the `while` loop with a `for` loop to iterate a specific number of times, making the code slightly more concise and readable.

